import Layout from "../../components/Layout";
import PostList from "../../components/PostList";
import Breadcrumb from "../../components/Breadcrumb";
import {
  getTagPaths,
  getSortedTagPostsData,
  getCategories,
  getTags,
} from "../../lib/posts";

export default function TagIndex({ tag, tagPostsData, categories, tags }) {
  return (
    <Layout
      pageTitle="Home"
      pageDescription="Home"
      categories={categories}
      tags={tags}
    >
      <section className="l-index">
        <Breadcrumb
          links={[
            {
              href: `/tag/${tag}`,
              title: tag,
            },
          ]}
        />

        <div className="index__title">{tag}の記事一覧</div>
        <PostList allPostData={tagPostsData} />
      </section>
    </Layout>
  );
}

export async function getStaticProps({ params }) {
  const tag = params.tag;
  const tagPostsData = getSortedTagPostsData(tag);
  const categories = getCategories();
  const tags = getTags();
  return {
    props: {
      tag,
      tagPostsData,
      categories,
      tags,
    },
  };
}

export async function getStaticPaths() {
  const paths = getTagPaths();
  return {
    paths,
    fallback: false,
  };
}
